import React from 'react';
import Register from './Register';
import {Link} from 'react-router-dom';

const Welcome = () => {
    return (
        <div>
            <img src="../../public/logo512.png" alt="Logo"></img>
            <br/>
            <button type="button">
                <Link to={Register}>Register</Link>
            </button>
        </div>
    )
};

export default Welcome;
